Gli obiettivi formativi del corso di laurea triennale in Scienze Geologiche sono:

* fornire una formazione di base nelle Scienze della Terra capace di fornire un valido supporto nelle operazioni di campagna e di laboratorio e nella lettura ed interpretazione degli elaborati tecnico-scientifici;
* formare competenze nel campo delle Scienze della Terra, in particolare l'acquisizione di conoscenze geologiche di base, strumenti e metodologie di indagine nel campo geologico, geomorfologico, geochimico, mineralogico-petrografico, geofisico e geologico-applicativo, attraverso attivita' di laboratorio e sul campo.<|eot_id|>

Secondo il documento, gli sbocchi occupazionali che il corso di laurea triennale in Scienze Geologiche offre sono:

- Aziende, società e studi professionali geotecnici e geodiagnostici
- Enti di ricerca petrolifera, ricerca di risorse idriche e geotermiche, minerali e rocce di interesse industriale
- Agenzie regionali per la protezione dell'ambiente e per il reperimento di fonti energetiche sostenibili
- Agenzie regionali per la prevenzione e mitigazione dei rischi geologici (rischio vulcanico, sismico, idrogeologico) ed ambientali (inquinamenti, smaltimento rifiuti urbani e industriali);
- Agenzie regionali per la valorizzazione dei beni culturali, ovvero per la gestione di musei naturalistici
- Industria della ceramica, dei refrattari, delle pietre ornamentali, dei cementi, dei vetri e gemmologia;
- Laboratori di analisi e certificazione dei materiali geologici;
- Università ed in enti di ricerca pubblici e privati come tecnico qualificato.<|eot_id|>

Le caratteristiche della prova finale del corso di laurea triennale in lingue e letterature - studi interculturali sono le seguenti:

- la prova finale consiste in una prova orale;
- la durata e la modalità della prova orale sono definite dal regolamento sulla prova finale del Corso di Laurea per ogni A.A., nel rispetto e in coerenza della tempistica delle prescrizioni ministeriali e delle inerenti linee guide di Ateneo;
- la prova finale è valutata in 3 CFU.<|eot_id|>

Le caratteristiche della prova finale del corso di laurea in Infermieristica sono le seguenti:

* la prova finale è consistente nella redazione e discussione di un elaborato scritto su un argomento teorico-pratico;
* la prova è preceduta da una prova professionale, abilitante alla professione di Infermiere, che può essere effettuata a letto di pazienti o come prova pratica simulata;
* gli elaborati potranno essere redatti anche in una lingua straniera preventivamente concordata;
* la prova finale ha valore di Esame di Stato abilitante all'esercizio professionale.<|eot_id|>

Gli obiettivi formativi del corso di laurea magistrale in Management dello sport e delle attività motorie sono:

* Conoscere le basi normative del sistema sportivo, considerato nella complessità dei suoi molteplici assetti (assetto istituzionale, assetto giurisdizionale, assetto amministrativo);
* Conoscere le problematiche relative alle interrelazioni tra ordinamento sportivo e ordinamento statale alla luce del principio di autonomia dell'ordinamento sportivo;
* Conoscere i principi e le dinamiche economiche operanti nell'ambito della gestione di imprese interessate a vario titolo al settore dello sport;
* Conoscere le normative vigenti, sia statali che federali, per operare a livello organizzativo e dirigenziale nell'ambito di enti facenti parte del sistema sportivo istituzionalizzato;
* Conoscere le normative vigenti in materia di sicurezza sui luoghi di lavoro, tutela della salute, politiche antidoping, accertamenti sulla idoneità all'esercizio di attività motorie e sportive, sicurezza e gestione di impianti sportivi, analisi funzionali metaboliche su praticanti di attività motorie e sportive.<|eot_id|>

