Profilo:
OPERATORE LINGUISTICO IN AMBITO DI INTERMEDIAZIONE SOCIO-CULTURALE
Funzioni:
Mediatore e facilitatore linguistico
Competenze:
- insegnamento della lingua italiana a stranieri;
- mediazione linguistica e interculturale in enti pubblici;
- interpretazione di trattativa;
- traduzione in ambito economico-commerciale, divulgativo, culturale, turistico;
- redazione di testi.
Sbocchi:
attività professionale autonoma o dipendente, in ambito linguistico-interculturale, presso aziende, istituzioni, strutture scolastico-educative,
organizzazioni ed enti nazionali ed internazionali, pubblici e privati; servizi di accoglienza e assistenza per immigrati.
Profilo:
OPERATORE LINGUISTICO IN AMBITO TURISTICO-CULTURALE
Funzioni:
Operatore linguistico e culturale
Competenze:
- Consulenza linguistico - culturale nell'industria e nel terziario (editoria, media, agenzie letterarie e culturali, mondo dell'arte e dello spettacolo);
- organizzazione e produzione di materiale culturale ed informativo nel settore turistico;
- programmazione e realizzazione di eventi interculturali;
- traduzione in ambito economico-commerciale, divulgativo, culturale, turistico; di ricerca documentale; di redazione di testi.
Sbocchi:
- Addetto linguistico in uffici organizzativi e di pubbliche relazioni nelle attività, come quelle editoriali, che richiedono competenze linguistiche, abilità di analisi;
- addetto alla traduzione presso enti ed aziende pubbliche e private, anche turistiche, case editrici, associazioni culturali, testate giornalistiche
- animatore culturale nel settore turistico - culturale.

La prova finale ha valore di esame di Stato abilitante all'esercizio della Professione e si compone di:
a) una prova pratica nel corso della quale lo studente deve dimostrare di aver acquisito le conoscenze e le abilita' teorico-pratiche proprie dello specifico profilo professionale;
b) la redazione e discussione di un elaborato breve che deve verificare le competenze acquisite del laureando su un argomento inerente le discipline presenti nel Manifesto degli Studi.
